package com.orderfleet.webapp.web.vendor.focus.dto;

public class UnitQtyOdooProductProfile {

	private double KGM;
	private double NOS;
	private double PCS;

	public double getKGM() {
		return KGM;
	}

	public void setKGM(double kGM) {
		KGM = kGM;
	}

	public double getNOS() {
		return NOS;
	}

	public void setNOS(double nOS) {
		NOS = nOS;
	}

	public double getPCS() {
		return PCS;
	}

	public void setPCS(double pCS) {
		PCS = pCS;
	}

}
